@polarbearelly ：Dear mama~~❤️❤️❤️ 謝謝你這13年來的照顧，雖然你常常出外工作，但你總是會抽空時間來陪我們，你總是在我身邊支持著我，在我想放棄時鼓勵我，在我開心時陪我笑，在我難過時叫我不要小題大作😂，雖然你自己很愛為了小事哭～但你真的是一個超級棒的媽媽，又堅強又脆弱！但你對我們的愛是無堅不摧的！We All Love You❤️🧡💛💚💙💜
也祝全世界最偉大的媽媽們母親節快樂🎉
By the way 我媽身材長相ㄧ級棒（這句絕對是媽媽逼我寫下的）

@hsu1124 ：親愛的媽媽， 謝謝您這幾年以來的照顧，雖然您常常不在家我還是很愛您，您就像是我感冒時的藥丸，用心的照顧我，等我長大時我一定會好好孝順您，祝您母親節快樂，我永遠愛您！

腿好細喔！
